import './index.css'
import { useEffect } from 'react';

const Modal = ({ post, onCloseModal}) => {



    return ( 
      <div className="modal">
      <div className="modal__content" onClick={(e) => e.stopPropagation()}>
        <div>{post.title}</div>
        <div>{post.text}</div>
        <div className="close" onClick={onCloseModal}>close</div>
      </div>
    </div>
    );
  }


  export default Modal;
